<!DOCTYPE html>
<html>

<head>

  <meta charset="UTF-8">

  <meta name="description" content="A new Flutter project.">


  <meta name="apple-mobile-web-app-capable" content="yes">
  <meta name="apple-mobile-web-app-status-bar-style" content="black">

  <link rel="icon" type="image/png" href="favicon.png" />

  <title>Dart URL Image</title>
  <link rel="manifest" href="manifest.json">
</head>

<body>
  <script src="main.dart.js" async></script>
  <script>
    if ('serviceWorker' in navigator) {
      window.addEventListener('flutter-first-frame', function() {
        navigator.serviceWorker.register('flutter_service_worker.js?v=1417913520');
        navigator.serviceWorker.register('flutter_service_worker.js?v=1871688344');
      });
    }
    window.addEventListener('load', function(ev) {
      entrypointUrl: "/main.dart.js",
      _flutter.loader.loadEntrypoint({
        serviceWorker: {
          serviceWorkerVersion: serviceWorkerVersion,
        },
        onEntrypointLoaded: function(engineInitializer) {
          engineInitializer.initializeEngine().then(function(appRunner) {
            appRunner.runApp();
          });
        }
      });
    });
  </script>

</body>

</html>
